#include <stdio.h>
#include <stdlib.h>
#include <string.h>


#define _WITHPRINT

typedef struct coup {
	int ligne;
	int colonne;
} coup;


int evaluer_plateau(int plateau[3][3], int joueur);
int Min(int plateau[3][3], int joueur, coup *meilleurcoup, int *nbnoeudsexplores, int *nbfeuillesexplorees);
int Max(int plateau[3][3], int joueur, coup *meilleurcoup, int *nbnoeudsexplores, int *nbfeuillesexplorees);

// Vérifie si le coup est jouable
int coup_jouable(int plateau[3][3], coup cp) {
	// Si coordonnées OK et case vide, le coup est jouable
	if(cp.ligne < 3 && cp.ligne >= 0)
		if(cp.colonne < 3 && cp.colonne >= 0)
			if(plateau[cp.ligne][cp.colonne] == 0)
				return 1; // Coup OK

	return 0; // Coup incorrect
}

int coups_possibles(int plateau[3][3], int affichage) {
	int i, j;
	coup cp;
	int nbc = 0;

	if(affichage)
		printf("Coup(s) possible(s) : ");

	for(i = 0; i < 3; i++) {
		for(j = 0; j < 3; j++) {
			cp.ligne = i;
			cp.colonne = j;

			if(coup_jouable(plateau, cp)) {
				if(affichage)
					printf("(%d / %d) ", cp.ligne+1, cp.colonne+1);
				nbc++;
			}
		}
	}

	if(affichage) {
		if(nbc == 0)
			printf("Aucun.\n");
		else
			printf("\n");
	}
	
	return nbc;
}

// Demande à l'humain de jouer son coup
void jouer_coup_humain(int plateau[3][3], int joueur) {
	coup cp;
	int result = 2;

	// Tant que le coup proposé n'est pas correct, on boucle
	while(result != 1) {
		// Message si le coup est incorrect
		if(result == 0)
			printf("Mauvaise position !\n");

		// Demande les coordonnées
		printf("Veuillez entrer la ligne et la colonne (X/X) : ");
		// Informations sur la lecture via scanf
		printf("%d coordonnées lues\n", scanf("%d/%d", &cp.ligne, &cp.colonne));

		// Décrémentation car l'indice du tableau part de 0
		cp.colonne--;
		cp.ligne--;

		// Analyse du coup
		result = coup_jouable(plateau, cp);
	}
	
	plateau[cp.ligne][cp.colonne] = joueur;
}

void jouer_coup_ordi(int plateau[3][3], int joueur, coup cp) {
	plateau[cp.ligne][cp.colonne] = joueur;
}

int Min(int plateau[3][3], int joueur, coup *meilleurcoup, int *nbnoeudsexplores, int *nbfeuillesexplorees) {
	coup cp; // Variable locale pour stocker un coup
	int v, w; // v est le coef le plus favorable à l'ordinateur (à priori)
	 // w sera la valeur du coef calculée par les appels à la fonctio Min
	 // à chaque remontée récursive, si le w est meilleur que v, v prendra la valeur de w
	int i,j;
	int tmp[3][3];

#ifdef _WITHPRINT
	printf("Noeuds min\n");
#endif

	// plus de coups possibles, on est donc sur une feuille
	if(coups_possibles(plateau, 1) == 0) {
		// c'est une feuille
		(*nbfeuillesexplorees)++;
		// je renvoie le coefficient du plateau (fonction la plus importante)
		return evaluer_plateau(plateau, joueur);
	} else {
		// Valeur par défaut de l'évaluation du plateau (on part du principe que le coup est défavorable)
		v = 10000;

		for(i = 0; i < 3; i++)
			for(j = 0; j < 3; j++) {
				cp.ligne = i;
				cp.colonne = j;
				if(coup_jouable(plateau, cp)) {
					// On recopie le tableau
					memcpy(tmp, plateau, 9*sizeof(int));
					// On joue le coup à la place du joueur
					jouer_coup_ordi(tmp, joueur%2+1, cp);
					// Noeud exploré
					(*nbnoeudsexplores)++;
#ifdef _WITHPRINT
					printf("Descente récursive coup (%d / %d)\n", cp.ligne+1, cp.colonne+1);
#endif
					w = Max(tmp, joueur, meilleurcoup, nbnoeudsexplores, nbfeuillesexplorees);
#ifdef _WITHPRINT
					printf("Remontée récursive coup(%d / %d)\n", cp.ligne+1, cp.colonne+1);
#endif
					if(w < v) {
						v = w;
						meilleurcoup->ligne = i;
						meilleurcoup->colonne = j;
					}
				}
			}
	}

	return 0;
}

int Max(int plateau[3][3], int joueur, coup *meilleurcoup, int *nbnoeudsexplores, int *nbfeuillesexplorees) {
	coup cp; // Variable locale pour stocker un coup
	int v, w; // v est le coef le plsu favorable à l'ordinateur (à priori)
	 // w sera la valeur du coef calculée par les appels à la fonctio Min
	 // à chaque remontée récursive, si le w est meilleur que v, v prendra la valeur de w
	int i,j;
	int tmp[3][3];

#ifdef _WITHPRINT
	printf("Noeuds max\n");
#endif

	// plus de coups possibles, on est donc sur une feuille
	if(coups_possibles(plateau, 1) == 0) {
		// c'est une feuille
		(*nbfeuillesexplorees)++;
		// je renvoie le coefficient du plateau (fonction la plus importante)
		return evaluer_plateau(plateau, joueur);
	} else {
		// Valeur par défaut de l'évaluation du plateau (on part du principe que le coup est défavorable)
		v = -10000;

		for(i = 0; i < 3; i++)
			for(j = 0; j < 3; j++) {
				cp.ligne = i;
				cp.colonne = j;
				if(coup_jouable(plateau, cp)) {
					// On recopie le tableau
					memcpy(tmp, plateau, 9*sizeof(int));
					// On joue le coup à la place du joueur
					jouer_coup_ordi(tmp, joueur%2+1, cp);
					// Noeud exploré
					(*nbnoeudsexplores)++;
#ifdef _WITHPRINT
					printf("Descente récursive coup (%d / %d)\n", cp.ligne+1, cp.colonne+1);
#endif
					w = Min(tmp, joueur, meilleurcoup, nbnoeudsexplores, nbfeuillesexplorees);
#ifdef _WITHPRINT
					printf("Remontée récursive coup(%d / %d)\n", cp.ligne+1, cp.colonne+1);
#endif
					if(w > v) {
						v = w;
						meilleurcoup->ligne = i;
						meilleurcoup->colonne = j;
					}
				}
			}
	}

	return 0;		
}

// Toutes les branches
void MinMax(int plateau[3][3], int joueur) {
	// Coup vide temporaire
	coup cp;
	cp.ligne = -1;
	cp.colonne = -1;

	// Avant les appels récursifs, rien n'a été exploré
	int nbnoeudsexplores = 0;
	int nbfeuillesexplorees = 0;

	// Construction de l'abre, l'ordinateur veut maximiser son coup'
	Max(plateau, joueur, &cp, &nbnoeudsexplores, &nbfeuillesexplorees);
#ifdef _WITHPRINT
	// Noeuds explorés
	printf("Noeuds explorés : %d\n", nbnoeudsexplores);
	printf("Feuilles explorées : %d\n", nbfeuillesexplorees);
#endif
	// Joue le coup trouvé
	plateau[cp.ligne][cp.colonne] = joueur;
}

// Toutes les branches dont la longueur est inférieure à n fixé
void MinMaxCut(int plateau[3][3], int joueur) {}

// Toutes les branches intéressantes
void MinMaxAB(int plateau[3][3], int joueur) {}

int evaluer_plateau(int plateau[3][3], int joueur) {
	int i, j = 0;
	int nbcase = 0;

	for(i = 0; i < 3; i++)
		if(plateau[i][j] == joueur)
			if((plateau[i][j+1] == plateau[i][j+2]) && (plateau[i][j+1] == joueur))
				return 1;

	i = 0;
	j = 0;

	for(j = 0; j < 3; j++)
		if(plateau[i][j] == joueur)
			if((plateau[i+1][j] == plateau[i+2][j]) && (plateau[i+1][j] == joueur))
				return 1;

	i = 0;
	j = 0;
	if(plateau[i][j] == joueur)
		if((plateau[i+1][j+1] == plateau[i+2][j+2]) && (plateau[i+1][j+1] == joueur))
			return 1;

	i = 2;
	j = 0;
	if(plateau[i][j] == joueur)
		if((plateau[i-1][j+1] == plateau[i-2][j+2]) && (plateau[i-1][j+1] == joueur))
			return 1;

	i = 0;
	j = 0;
	for(j = 0; j < 3; j++)
		for(i = 0; i < 3; i++)
			if(plateau[i][j] != 0)
				nbcase++;
	
	return (nbcase == 9) ? 2 : 0;
}

// Affiche le plateau dans la console
void afficher_plateau(int plateau[3][3]) {
	printf("-------\n");
	for(int i = 0; i < 3; i++) {
		printf("|");
		for(int j = 0; j < 3; j++) {
			printf("%c|", (plateau[i][j] == 1) ? 'O' : ((plateau[i][j] == 2) ? 'X' : ' '));
		}
		printf("\n");
	}
	printf("-------\n\n");
}


int main(int argc, char **argv) {
	int algorithme = 0;
	if(argc >= 2) {
		if(strcmp(argv[1], "MinMax") == 0)
			algorithme = 0;
		else if(strcmp(argv[1], "MinMaxCut") == 0)
			algorithme = 1;
		else
			algorithme = 2;
	}
	
	// Stocke le joueur courant et le résultat
	int joueur, resultat;

	// Plateau vide et symboles joueurs
	int plateau[3][3] = {{0}};
	char joueurs[2] = {'O', 'X'};
	int fin = 0;

	printf("Bienvenue dans TicTacToe\n\n");
	//  Premier joueur
	joueur = 1;


	// Tant que la partie n'est pas finie
	while(fin != 1) {
		printf("> Joueur %c\n", joueurs[joueur-1]);

		// Si le joueur est humain, on lui demande les coordonnées
		if(joueur == 1) {
			coups_possibles(plateau, 1);

			// Fait jouer l'humain
			jouer_coup_humain(plateau, joueur);
		}
		else { // Sinon on teste les meilleurs coups
			switch(algorithme) {
				case 1: // Comme MinMax, mais l'arbre est limité en hauteur (on limite les rappels)
					MinMaxCut(plateau, joueur);
					break;
				case 2: // Comme MinMax, mais l'abre est limité en largeur (on élimine certaines branches avant même des les avoir parcourues+)
					MinMaxAB(plateau, joueur);
					break;
				default: // Génération de l'arbre entier et choix d'une branche ammenant vers la victoire
					MinMax(plateau, joueur);
					break;
			}
		}

		afficher_plateau(plateau);
		resultat = evaluer_plateau(plateau, joueur);

		if(resultat == 1) {
			fin = 1;
			printf("Joueur %c vainqueur\n", joueurs[joueur-1]);
		} else if(resultat == 2) {
			fin = 1;
			printf("Match nul\n");
		}

		joueur = joueur % 2 + 1;
	}

	getchar();
	return 0;
}
